import React from "react";
import ReactDOM from "react-dom";
import css from './index.css';



        

class Timer extends React.Component {
    render() {
        var hh = 0;
        var mm = 0;
        return(
            <div className="timer">
                <span>{hh}</span>
                <span>:</span>
                <span>{mm}</span>
            </div>
        )
    }
}

ReactDOM.render(
    <Timer/>,
    document.getElementById('root')
)
